Create PROCEDURE sp_AddAgentRating
	@AgentRatingsID int,
	@BookingID int,
	@AgentID int,
	@CustomerID int,
	@AgentRatings int,
	@Feedback nvarchar(255),
	@DateCreated datetime2
AS

BEGIN
	INSERT INTO Bookings(
		AgentID,
		CustomerID,
		PropertyID,
		VisitDate,
		VisitTime,
		BookingStatus,
		BookingPostStatus,
		DateCreated)
	VALUES(
		@AgentID,
		@CustomerID,
		@PropertyID,
		@VisitDate,
		@VisitTime,
		@BookingStatus,
		@BookingPostStatus,
		@DateCreated);
END
RETURN 0

