CREATE PROCEDURE [dbo].[sp_AddNewSubscription]
    @SubscriptionTypeID INT,
    @AgentID INT,
    @ReferenceNumber NVARCHAR(255),
	@SubPhoto NVARCHAR(MAX)
AS

BEGIN
	INSERT INTO Properties(
		AgentID,
		PropertyCategoryID,
		PropertyTypeID,
		PropertyName,
		Overview,
		TotalPrice, 
		Bedrooms, 
		Bathrooms, 
		FloorAreaSize, 
		DevelopmentInfo, 
		PropertyStatus, 
		DateCreated) 
	VALUES (
		@AgentID,
		@PropertyCategoryID,
		@PropertyTypeID,
		@PropertyName, 
		@Overview, 
		@TotalPrice, 
		@Bedrooms,
		@Bathrooms, 
		@FloorAreaSize, 
		@DevelopmentInfo, 
		@PropertyStatus, 
		@DateCreated)

	SET @PropertyID = SCOPE_IDENTITY()

	INSERT INTO PropertyLocation(
		PropertyID,
		Region, 
		Municipality, 
		City, 
		Barangay, 
		Street, 
		ZipCode)
	VALUES (
		@PropertyID,
		@Region,
		@Municipality, 
		@City, 
		@Barangay, 
		@Street,
		@Zipcode)

	INSERT INTO Amenities(
		PropertyID,
		AmenitiesName)
	VALUES (
		@PropertyID,
		@AmenitiesName)

	INSERT INTO Features(
		PropertyID,
		FeaturesName)
	VALUES (
		@PropertyID,
		@FeaturesName)

	INSERT INTO PropertyRatings(
		PropertyID,
		RoadRatings,
		SafetyRatings,
		CleanlinessRatings,
		ParkingRatings,
		TrafficRatings,
		SchoolRatings,
		RestaurantRatings,
		TotalRatings)
	VALUES (
		@PropertyID,
		@RoadRatings,
		@SafetyRatings,
		@CleanlinessRatings,
		@ParkingRatings,
		@TrafficRatings,
		@SchoolRatings,
		@RestaurantRatings,
		@TotalRatings)

	INSERT INTO PropertyPhotos (
		PropertyID,
		MainPhoto,
		SecondPhoto,
		ThirdPhoto,
		FourthPhoto,
		FifthPhoto,
		SixthPhoto,
		SeventhPhoto,
		EightPhoto,
		NinthPhoto,
		TenthPhoto)
	VALUES (
		@PropertyID,
		@MainPhoto,
		@SecondPhoto,
		@ThirdPhoto,
		@FourthPhoto,
		@FifthPhoto,
		@SixthPhoto,
		@SeventhPhoto,
		@EightPhoto,
		@NinthPhoto,
		@TenthPhoto)
END
RETURN 0

