    @OldPassword NVARCHAR(MAX),
	@NewPassword NVARCHAR(MAX),
    @CustomerID int
AS

BEGIN
    SET NOCOUNT ON;

    UPDATE Agents
    SET IsEmailVerified = 1, ActivationCode = NULL
    WHERE ActivationCode = @ActivationCode;
END;

